import React from 'react'

const ImageList = (props) => {
  const style = { display: 'grid' }
  const images = props.pics.map(({ description, id, urls }) => <img key={id} src={urls.regular} alt={description}></img>)
  return(
    <div>
      {images}
    </div>
  )
}

export default ImageList
